webpackJsonp([79352659261503],{1465:function(p,a){p.exports={data:{markdownRemark:{html:"<p>大きな夜の夕方を歩いて、気温が上がって暑いですが、ここの緑はまだまだ青々としています。天気は暑く、池の魚は水面に浮かんでゆっくりと浮かび上がり、動きもなく、世界の戦いは止まってしまったようです。それらを見ると、一種のゆっくりとした味が生まれます。詩を入手する：</p>\n<p>山のノスタルジア</p>\n<p>巻線の経路には木々があり、</p>\n<p>波は静かで、山は明るいです。</p>\n<p>釣りを放棄した後、</p>\n<p>フライング鹊林Zhongxiangを聞く前に。</p>\n<p>何千ものものが世界中にあります。</p>\n<p>瞬間は涼しいだけです。</p>\n<p>石の道を運ぶ夕暮れの光、</p>\n<p>橋は古代の道路馬を傾けた。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0113.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0113.md",frontmatter:{title:"6月13日 月曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0113.md absPath of file >>> MarkdownRemark"}}}});
